import React from 'react';
import './BillList.css';

let billList = [
    {
        date: "2021.6.5",
        nums: 3,
        list: [
            {
                category: "food",
                type: 0,
                amount: 100,
                remark: "火锅1"
            },
            {
                category: "food",
                type: 0,
                amount: 100,
                remark: "火锅2"
            },
            {
                category: "food",
                type: 0,
                amount: 100,
                remark: "火锅3"
            },
        ]
    },
    {
        date: "2021.6.8",
        nums: 2,
        list: [
            {
                category: "food",
                type: 0,
                amount: 100,
                remark: "火锅1"
            },
            {
                category: "food",
                type: 1,
                amount: 1000,
                remark: "火锅2"
            }
        ]
    },
    {
        date: "2021.6.15",
        nums: 1,
        list: [
            {
                category: "food",
                type: 0,
                amount: 100,
                remark: "火锅1"
            }
        ]
    }
]
export default class BillList extends React.Component{
    constructor(props) {
        super(props);

    }

    componentDidMount() {
    }

    render() {
        const listItem = billList.map(oneDay => {
            return (
                <div>
                    <div>
                        <p>oneDay.date</p>
                    </div>
                    <ul>
                        {oneDay.list.map(item => {
                            return (
                                <div>
                                    <div>
                                        <p>{item.category}</p>
                                        <p>{item.remark}</p>
                                    </div>
                                    <div>
                                        <p><span>{item.type === 0 ? "+" : "-"}</span>{item.amount}</p>
                                    </div>
                                </div>
                            )
                        })}
                    </ul>
                </div>
            )
        });
        return(
            <div>
                <div>
                {/*    顶部*/}
                </div>
                <div>
                    <ul>{listItem}</ul>
                </div>
            </div>
        )
    }
}
